import React from 'react';

function ProjectCard({ name, description, start_date, end_date, status, user_id }) {


  return (
    <div>
      <h2>{name}</h2>
      <p>{description}</p>
      <p>Start Date: {start_date}</p>
      <p>End Date: {end_date}</p>
      <p>Status: {status}</p>
      <p>User ID: {user_id}</p>
    </div>
  );
}

export default ProjectCard;
